(38, 'Granze (Abhay pvt)', '<div class=\"headingsection\" style=\"-webkit-font-smoothing: antialiased; padding: 0px 0px 30px; color: rgb(33, 37, 41); font-family: Roboto, sans-serif;\"><h4 style=\"-webkit-font-smoothing: antialiased; margin-top: 10px; margin-right: 0px; margin-left: 0px; font-weight: 500; font-size: 14px; color: rgb(51, 51, 51); letter-spacing: 1px; font-family: Roboto !important;\">The grezns</h4></div><p style=\"-webkit-font-smoothing: antialiased; margin-bottom: 1rem; letter-spacing: 1.5px; line-height: 22px; color: rgb(33, 37, 41); font-family: &quot;Nanum Myeongjo&quot; !important;\">We\'ll begin with a discovery call where you\'ll tell me all your ideas and dreams for your new brand! I\'ll also use this time to fill you in on the brand process and answer any questions. If it looks like we\'re a good fit, I\'ll send over a project timeline and some brand \"homework.\" (it\'s fun, I promise!)</p><p style=\"-webkit-font-smoothing: antialiased; margin-bottom: 1rem; letter-spacing: 1.5px; line-height: 22px; color: rgb(33, 37, 41); font-family: &quot;Nanum Myeongjo&quot; !important;\">Next, youll receive a PDF with an in-depth analysis of your brand strategy as well as a mood board to make sure we\'re on the right track. Once we finalize this stage, Ill get to work on the fun part, designing your beautiful brand!</p><div><br></div>', 'Unlimited usage during the membership validity period. Experience true infinity Enjoy Wizard-exclusive, exciting deals at The Grezns', 'granze', NULL, NULL, 'Vikaspuri, New Delhi, Delhi, India', NULL, 'thegrenze@gmail.com', '3254169852', NULL, 'public/hotel/Granze (Abhay pvt)/14txrbn69izQYMFQh6FN8DgGcYymfrxl4583nDF2.png', '[[\"public\\/hotel\\/Granze (Abhay pvt)\\/5iIenZBZGo8wPCJMC86BiZMqDOOXveoeOixcJ58S.jpg\"],[\"public\\/hotel\\/Granze (Abhay pvt)\\/bQkn7vpWhqCPMQUhrc8oFohh9tELM589AHimB3FL.jpg\"],[\"public\\/hotel\\/Granze (Abhay pvt)\\/6BD4ayodLrOa4soTj5sSmFMtAsU1nctZKgoimetb.jpg\"],[\"public\\/hotel\\/Granze (Abhay pvt)\\/fBTSZ8p4lywcfs3oFUwRVJF2CG16Jm1UtGHUe5ia.jpg\"],[\"public\\/hotel\\/Granze (Abhay pvt)\\/iJAu3jsFDg2OdCa9AyHrUXVYYOgiqewNrSHj9iOs.jpg\"]]', '06:30', '23:00', '28.6386438', '77.07206', 99, 1483, 1, 'null', '2022-01-16 04:51:07', '2022-01-16 04:51:07');
