INSERT INTO `rooms_descriptions` (`id`, `room_id`, `name`, `description`, `meta`, `tag`, `keyword`, `price`, `quantity`, `room_prefix`, `booking_prefix`, `adult`, `child`, `booking_from`, `booking_till`, `image`, `image_bulk`, `status`, `created_at`, `updated_at`) VALUES
(6, '6', 'Hollywood Twin Room', '<span style=\"font-weight: bolder; color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\">Hollywood Twin Room:</span><span style=\"color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\">&nbsp;A room that can accommodate two persons with two twin beds joined together by a common headboard. Most of the&nbsp;</span><span class=\"mytool\" style=\"color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\"><a href=\"https://setupmyhotel.com/homepage/hotel-management-glossary/budget-hotels.html\" title=\"It focuses on meetings the most basic needs of guest providing clean, comfortable and inexpensive rooms. Also known as economy or limited services hotels, they appeal primarily to budget-minded travellers and groups.&nbsp;...\" style=\"color: rgb(0, 83, 249); text-decoration: none; transition: color 400ms ease 0s, background-color 400ms ease 0s;\">budget hotels</a></span><span style=\"color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\">&nbsp;tend to provide many of these room settings which cater both couples and parties in two.</span>', 'hollywood', NULL, NULL, 1000.00, 10, 'holl', 'holl', '1', '10', '2022-01-17', '2022-01-18', 'public/hotel/abhay hotal/rooms/TqnREWEPgXVC5sHdAq5eonio4QPjr6MEQ4WzSqVi.jpg', '[[\"public\\/hotel\\/abhay hotal\\/rooms\\/fyZJsPrgadyAQLF2AyzKK9k30TdXxpL9Uov1kPek.jpg\"],[\"public\\/hotel\\/abhay hotal\\/rooms\\/37DvsgDaossg8cC072SQfEIVXlx3gVmbJvTbBVVw.jpg\"]]', '1', '2022-01-16 05:10:45', '2022-01-16 05:10:45'),
(7, '7', 'Studio', '<p style=\"margin-bottom: 1rem; color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\"><span style=\"font-weight: bolder;\">Studio:</span>&nbsp;A room with a&nbsp;<span class=\"mytool\"><a href=\"https://setupmyhotel.com/homepage/hotel-management-glossary/studio.html\" title=\"A guest room having one or two couches that convert into beds.\" style=\"color: rgb(0, 83, 249); text-decoration: none; transition: color 400ms ease 0s, background-color 400ms ease 0s;\">studio</a></span>&nbsp;bed- a couch which can be converted into a bed. May also have an additional bed.</p><p style=\"margin-bottom: 1rem; color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\">The room size or area of Studio&nbsp;<span class=\"mytool\"><a href=\"https://setupmyhotel.com/homepage/hotel-management-glossary/guestroom-types.html\" title=\"Guestroom types are a differentiation among the varieties of guestroom based on types of sleeping accommodations or equipment; usually identified by specific symbols as follows:   t - room with one twin bed   tt - room with two twin beds;   d - room with one double bed   dd - room with two double beds   st - studio, room with a Day bed or convertible sofa.   q - room with one queen bed; k, room with one king bed.   p - parlor sitting room usually having hidden sleep equipment, may be set For a small meeting or hospitality function;   s - suite, two or more rooms that connect internally and are sold as one unit;   con - rooms that are adjacent and Connect internally   bs - bilevel suite, a suite on two levels having an internal stairway between levels.   es - executive suite, a high-quality suite, usually having two or more rooms but only one with access to the hotel corridor.   Also, read about different room types in hotels.\" style=\"color: rgb(0, 83, 249); text-decoration: none; transition: color 400ms ease 0s, background-color 400ms ease 0s;\">room types</a></span>&nbsp;are generally between 25 m to 40 m.</p>', 'studio', NULL, NULL, 200.00, 1, 'Studio', 'Studio', '2', '22', '2022-01-26', '2022-01-28', 'public/hotel/Radisson Blue/rooms/mAvGwm7k7T0zHgwyiHub6R6VjFWoURi0k1APGHcg.jpg', '[[\"public\\/hotel\\/Radisson Blue\\/rooms\\/xsGkE2K28ONWMs9JkxO8XyjjxdQcLeNof88F97K0.jpg\"]]', '1', '2022-01-16 05:13:58', '2022-01-16 05:13:58'),
(8, '8', 'Suite  Executive Suite', '<p style=\"margin-bottom: 1rem; color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\"><span style=\"font-weight: bolder;\">Suite / Executive Suite:&nbsp;</span>A parlour or living room connected with to one or more bedrooms. (A room with one or more bedrooms and a separate living space.)</p><p style=\"margin-bottom: 1rem; color: rgb(44, 46, 54); font-family: Verdana, Geneva, sans-serif, Arial, Helvetica, sans-serif; font-size: 18px; text-align: justify;\">The room size or area of&nbsp;<span class=\"mytool\"><a href=\"https://setupmyhotel.com/homepage/hotel-management-glossary/suite.html\" title=\"1) A guest room with a parlour/living area in addition to a sleeping room and perhaps a kitchenette. 2) Several pieces of furniture of similar design, usually sold together to outfit a complete room.\" style=\"color: rgb(0, 83, 249); text-decoration: none; transition: color 400ms ease 0s, background-color 400ms ease 0s;\">Suite</a></span>&nbsp;rooms are generally between 70 m to 100 m.</p><div><br></div>', 'Suite', NULL, NULL, 120.00, 10, 'suite', 'suite', '3', '33', '2022-01-18', '2022-01-26', 'public/hotel/Granze (Abhay pvt)/rooms/16TgeIb54s8sBIpgzRoOTFOH2PsbFOx8mA6SMBRE.jpg', '[[\"public\\/hotel\\/Granze (Abhay pvt)\\/rooms\\/9DygM3YH2SxBJlmAJmqjFnbQpQ3dG9HdgJf24p63.jpg\"]]', '1', '2022-01-16 05:17:20', '2022-01-16 05:17:20');
